import React from 'react';

import Header from '../components/Header';

import { Container, DivPlane } from './index-styles';

export default function Home() {
  return ( 
    <>
      <Header page="inicio" />
      <Container>
        <img  
          className="heroText"
          src="/assets/images/hero_text.svg"
        /> 
        <img
          className="heroBanner"
          src="/assets/images/hero_banner.svg"  
        />

        <h2>RECENTES NO BLOG</h2>
        <h5>Informações do mundo da tecnologia, cursos e dicas para desenvolvedores e empresários</h5>

        <DivPlane>
          <img className="planeText" src="/assets/images/plane_text.svg" />
          <img className="planeImage" src="/assets/images/plane.svg" />
        </DivPlane>

      </Container>
    </>
  );
}
